import React, { useState } from 'react';

const StuAdmisRequApplPage = () => {
    const [studentId, setStudentId] = useState('');
    const [studentName, setStudentName] = useState('');
    const [fullName, setFullName] = useState('');
    const [email, setEmail] = useState('');
    const [telephone, setTelephone] = useState('');
    const [mobile, setMobile] = useState('');
    const [firstAttempt, setFirstAttempt] = useState('');
    const [secondAttempt, setSecondAttempt] = useState('');
    const [selectedExam, setSelectedExam] = useState('');
    const [courseTitle, setCourseTitle] = useState('');
    const [courseCode, setCourseCode] = useState('');
  
    const handleSubmit = () => {
      // Your logic to handle form submission goes here
      // You can access all the form values from the state variables
      // For example: studentId, studentName, email, etc.
      console.log('Form submitted!');
    };
  
    return (
      <div>
        <h2>Student Information</h2>
        <div>
          <label>Student ID:</label>
          <input type="text" value={studentId} onChange={(e) => setStudentId(e.target.value)} />
        </div>
        <div>
          <label>Student Name with Initials:</label>
          <input type="text" value={studentName} onChange={(e) => setStudentName(e.target.value)} />
        </div>
        <div>
          <label>Full Name:</label>
          <input type="text" value={fullName} onChange={(e) => setFullName(e.target.value)} />
        </div>
        <div>
          <label>Email:</label>
          <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} />
        </div>
        <div>
          <label>Telephone:</label>
          <input type="tel" value={telephone} onChange={(e) => setTelephone(e.target.value)} />
        </div>
        <div>
          <label>Mobile:</label>
          <input type="tel" value={mobile} onChange={(e) => setMobile(e.target.value)} />
        </div>
        <div>
        <h6>Attempts</h6>
          <label>1st:</label>
          <input type="text" value={firstAttempt} onChange={(e) => setFirstAttempt(e.target.value)} />
        </div>
        <div>
          <label>2nd:</label>
          <input type="text" value={secondAttempt} onChange={(e) => setSecondAttempt(e.target.value)} />
        </div>
  
        <div>
          <label>Exam (mid/end):</label>
          <select value={selectedExam} onChange={(e) => setSelectedExam(e.target.value)}>
            <option value="">Select Exam Type</option>
            <option value="mid">Mid Exam</option>
            <option value="end">End Exam</option>
          </select>
        </div>
        <div>
          <label>Course Title:</label>
          <input type="text" value={courseTitle} onChange={(e) => setCourseTitle(e.target.value)} />
        </div>
        <div>
          <label>Course Code:</label>
          <input type="text" value={courseCode} onChange={(e) => setCourseCode(e.target.value)} />
        </div>
  
        <div>
          <button onClick={handleSubmit}>Submit</button>
          <button>Preview</button>
          <button>Back</button>
        </div>
      </div>
    );
  };
  

export default StuAdmisRequApplPage;
